module Codecs.Mp3.HuffArrays where

import Data.Array
import Control.Monad (liftM)
import Data.Binary.BitString.BitGet

-- SmallTable / Deep Table
type MP3Huffman a = Either (HuffArray a) (HuffDeep a)
type HuffArray a = (Int, Array Int (Int, a))  -- plain lookup
type HuffDeep a  = (Int,                      -- code word length
                    Array Int (Either (Int,a) -- we may find values
                              (HuffArray a))) -- and we may find arrays

-- Table# -> (linbits,table)
getTree :: Int -> (Int,MP3Huffman (Int,Int))
getTree x = case x of
    0  -> (0,table0)
    1  -> (0,table1)
    2  -> (0,table2)
    3  -> (0,table3)
    -- 4 not used
    5  -> (0,table5)
    6  -> (0,table6)
    7  -> (0,table7)
    8  -> (0,table8)
    9  -> (0,table9)
    10 -> (0,table10)
    11 -> (0,table11)
    12 -> (0,table12)
    13 -> (0,table13)
    -- 14 not used
    15 -> (0,table15)
    16 -> (1,table16)
    17 -> (2,table16)
    18 -> (3,table16)
    19 -> (4,table16)
    20 -> (6,table16)
    21 -> (8,table16)
    22 -> (10,table16)
    23 -> (13,table16)
    24 -> (4,table24)
    25 -> (5,table24)
    26 -> (6,table24)
    27 -> (7,table24)
    28 -> (8,table24)
    29 -> (9,table24)
    30 -> (11,table24)
    31 -> (13,table24)
    _  -> error "no such huff table"    

-- Lookup a value in the huffman array
lookupHuff :: Monad m =>MP3Huffman a -> BitGetT m (Int,a)
lookupHuff huff = case huff of
    Left  (cw,arr) -> liftM (arr !) (f cw)
    Right (cw,arr) -> do
        i <- f cw
        case arr ! i of
            Left a           -> return a
            Right (cw',arr') -> do
                (l,a) <- liftM (arr' !) (f cw')
                return (cw+l,a) -- total read: cw + l
  where
    f w | w <= 8  = liftM fromIntegral (getAsWord8  $ fromIntegral w)
        | w <= 16 = liftM fromIntegral (getAsWord16 $ fromIntegral w)

-- Get the quadruple tables
getQuadrTable :: Bool -> MP3Huffman (Int,Int,Int,Int)
getQuadrTable True  = Left (4,quadrTable2)
getQuadrTable False = Left (6,quadrTable1)

